import React from 'react';
import Card from 'react-bootstrap/Card';

function Cards({ item }) {
  return (
    <div className=''>
      <Card>
        <Card.Body>
          <img src={item.img} alt="" />
        </Card.Body>
      </Card>
    </div>
  );
}

export default Cards;
